schemaDefinition: "create or replace view U_TOTAL_MONTHLY_INSTANCE_TRANSACTION(\n\t\
  \"PspPerUpdateDt\",\n\t\"SysTags\",\n\t\"UCompany\",\n\t\"SysId\",\n\t\"DvUInstance\"\
  ,\n\t\"PspPerInsertDt\",\n\t\"SysCreatedBy\",\n\t\"DvUCompany\",\n\t\"SysUpdatedOn\"\
  ,\n\t\"SysModCount\",\n\t\"UTotalTransactions\",\n\t\"PspPerDeleteDt\",\n\t\"UInstance\"\
  ,\n\t\"SysUpdatedBy\",\n\t\"UMonth\",\n\t\"SysCreatedOn\"\n) as -- SEMANTIC LAYER\
  \ BEGINS\n\nSELECT \"PSP_PER_UPDATE_DT\" as \"PspPerUpdateDt\",\n       \"SYS_TAGS\"\
  \ as \"SysTags\",\n       \"U_COMPANY\" as \"UCompany\",\n       \"SYS_ID\" as \"\
  SysId\",\n       \"DV_U_INSTANCE\" as \"DvUInstance\",\n       \"PSP_PER_INSERT_DT\"\
  \ as \"PspPerInsertDt\",\n       \"SYS_CREATED_BY\" as \"SysCreatedBy\",\n     \
  \  \"DV_U_COMPANY\" as \"DvUCompany\",\n       \"SYS_UPDATED_ON\" as \"SysUpdatedOn\"\
  ,\n       \"SYS_MOD_COUNT\" as \"SysModCount\",\n       \"U_TOTAL_TRANSACTIONS\"\
  \ as \"UTotalTransactions\",\n       \"PSP_PER_DELETE_DT\" as \"PspPerDeleteDt\"\
  ,\n       \"U_INSTANCE\" as \"UInstance\",\n       \"SYS_UPDATED_BY\" as \"SysUpdatedBy\"\
  ,\n       \"U_MONTH\" as \"UMonth\",\n       \"SYS_CREATED_ON\" as \"SysCreatedOn\"\
  \nFROM \"RDS\".\"HI\".\"U_TOTAL_MONTHLY_INSTANCE_TRANSACTION\";"
